function App() {
  return (
    <Router>
      <Routes>
        <Route exact path="/" element={<Landing />}/>
        <Route exact path="/home" element={<QuestionAnswer />}/>
        <Route exact path="//medical-question" element={<MedicalAnswerPage />}/>
      </Routes>
    </Router>
  );
}

export default App;


